310	507	articles	1	{"id":1,"status":"published","user_created":"23d707b6-2d9c-42f2-bd80-64562706cb2d","date_created":"2023-05-16T20:18:55.896Z","date_updated":"2023-05-24T20:42:19.751Z","title":"My first article","slug":"my-first-article","description":"The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.","body":"<h1>Heading 1</h1>\\n<p>On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.</p>","cover":"9a572cf4-bd50-4819-8a3b-ed0bccb3ee55"}	{"title":"My first article","date_updated":"2023-05-24T20:42:19.751Z"}	\N
